import logo from './logo.svg';
import 'App.css';

function App() {
  const pageTitle = document.title;

  window.addEventListener("blur", () => {
        document.title = "Come back here...";
  });

  window.addEventListener("focus", () => {
        document.title = pageTitle;
  });

  return (
    <div className='div1'>Hello world</div>
  );

}

export default App;
